function tangent(a, b) {
    const dx = b[0] - a[0];
    const dy = b[1] - a[1];
    const d = Math.sqrt(dx * dx + dy * dy);
    return [dx / d, dy / d];
}

function normal(a, b) {
    const dx = b[0] - a[0];
    const dy = b[1] - a[1];
    const d = Math.sqrt(dx * dx + dy * dy);
    return [dy / d, -dx / d];
}


function redPointsSvg(points) {
    const results = ['<g class="seed-points">'];
    for (let i = 0; i < points.length; i++) {
        const p = points[i];
        results.push(`<circle class="point-${i}" cx="${p[0]}" cy="${p[1]}" r="2"/>`);
    }
    results.push('</g>');
    return results.join('');
}

